CREATE DEFINER=`mm_team02_02`@`%` PROCEDURE `GetEligibleDonorsByBloodGroup`(IN input_bloodgroup VARCHAR(3))
BEGIN
	SELECT DonorID, Concat(FirstName," ",LastName) AS Name, BloodGroup, LastDonationDate, Phone 
    FROM Donor 
    WHERE LastDonationDate <= DATE_SUB(NOW(), INTERVAL 3 MONTH)
    AND BloodGroup = input_bloodgroup
    ORDER BY LastDonationDate DESC;
END ;;
